import React ,{Component } from 'react';
import './Note.css'; 
import PropType from 'prop-types';

class Note extends Component{
    constructor(props){
        super(props);
        this.message="hello from node.js";

    }
    render(){
        return (
            <div>
                <h1> {this.message}</h1>
            </div>
        );
    }
}

export default Note;
